import { useContext } from 'react'
import ControlPanelContext from '../../../../../Context/ControlPanelContext'
import styles from '../ControlPanel.module.scss'

function CreateBrand() {
    return (
        <div>CreateBrand</div>
    )
}
function GetBrand() {
    return (
        <div>GetBrand</div>
    )
}
function UpdateBrand() {
    return (
        <div>UpdateBrand</div>
    )
}
function DeleteBrand() {
    return (
        <div>DeleteBrand</div>
    )
}

function MethodBrands() {
    const value = useContext(ControlPanelContext)
    if (value.state === 'Создать')
        return (<CreateBrand />)
    else if (value.state === 'Получить')
        return (<GetBrand />)
    else if (value.state === 'Обновить')
        return (<UpdateBrand />)
    else if (value.state === 'Удалить')
        return (<DeleteBrand />)
    else return (<div>Этот компонент пока не создан</div>)
}
export default function Brands() {
    return (
        <div className={styles['controlPanel-brand']}>

        </div>
    )
}
